// products.js

const products = [
    {
      id: 1,
      title: "Custom Product 1",
      category: "Category 1",
      description: "Description of custom product 1",
      price: 100,
      image: "homebali.jpg",
      rating: { rate: 4.5, count: 10 },
    },
    {
      id: 2,
      title: "Custom Product 2",
      category: "Category 1",
      description: "Description of custom product 2",
      price: 150,
      image: "aboutus.jpg",
      rating: { rate: 4.0, count: 8 },
    },
    // Add more custom products as needed
  ];

  export default products;
